var projectList = require("./projectList");

module.exports = function(url, callback){
    $.ajax({
        method: "GET",
        url: url,
        dataType: "json",
        cache: false,
        success: function(data){
            console.log(data);
            projectList("projects/", callback);
        },
        error: function(status){
            console.error(status);
        }
    });
};
